    -- 31. Cuantas películas ha realizado el actor ED CHASE.
select count(f.film_id) as films from film as f join film_actor as fa on f.film_id=fa.film_id join actor as a on a.actor_id=fa.actor_id where a.first_name='Ed' and a.last_name='Chase';
