-- 2. Crea 5 vistas sobre la BBDD, y realizar la consulta, para mostrar los resultados. Las vistas deben de tener 3 o más tablas de la BBDD.
-- View structure for view `customer_rental_film_payment`
-- Este view incluye las tablas customer, rental, inventory, film, payment
create view customer_rental_film_payment as
select
customer.customer_id as CID, 
concat(customer.first_name, ' ', customer.last_name) as customer_name,
rental.rental_id as RID, 
rental.rental_date as rental_date, 
rental.return_date as return_date,
film.title as film_title, 
payment.amount as payment_amount, 
payment.payment_date as payment_date
from
customer join rental 
on customer.customer_id = rental.customer_id
join inventory 
on rental.inventory_id = inventory.inventory_id
join film 
on inventory.film_id = film.film_id
join payment 
on rental.rental_id = payment.rental_id;
