-- View structure for view `store_inventory_info`
-- Este view incluye las tablas address, store, inventory, film, film_category, category
create view store_inventory_info as
select
inventory.inventory_id as IID,
inventory.last_update as last_update,
film.title as title,
category.name as category,
inventory.store_id as SID,
address.address as address
from 
category left join film_category 
on category.category_id = film_category.category_id 
left join film
on film_category.film_id = film.film_id
join inventory
on film.film_id=inventory.film_id
join store
on inventory.store_id=store.store_id
join address
on store.address_id=address.address_id;
