-- View structure for view `customer_address_info`
-- Este view incluye las tablas customer, address, city, country
create view customer_address_info as
select
customer.customer_id as CID, 
concat(customer.first_name, ' ', customer.last_name) as customer_name, 
address.address_id as AID, 
address.address as address,
address.postal_code as postal_code, 
address.phone as phone, 
city.city as city_name, 
country.country as country_name
from
customer join address
on customer.address_id = address.address_id
join city
on address.city_id = city.city_id
join country 
on city.country_id = country.country_id;
