-- View structure for view `film_actor_category_info`
-- Este view incluye las tablas film, film_actor, actor, film_category, category
create view film_actor_category_info as
select
film.film_id as FID, 
film.title as film_title, 
film.description as film_description,
category.name as category,
concat(actor.first_name, ' ', actor.last_name) as actor_names
from
film join film_actor
on film.film_id = film_actor.film_id
join actor
on film_actor.actor_id = actor.actor_id
join film_category
on film.film_id = film_category.film_id
join category
on film_category.category_id = category.category_id;
