-- View structure for view `film_actor_category_info`
-- Este view incluye las tablas film, film_actor, actor, film_category, category
create view staff_store_address_info as
select
staff.staff_id as STID, 
concat(staff.first_name, ' ', staff.last_name) as staff_name, 
store.store_id as SID, 
address.address as address, 
address.district as district,
address.postal_code as postal_code,
address.phone as phone,
city.city as city_name, 
country.country as country_name
from 
staff join store
on staff.store_id = store.store_id
join address
on store.address_id = address.address_id
join city
on address.city_id = city.city_id
join country
on city.country_id = country.country_id;
